    a_part_1 = b[0] - a[0]
    b_part_1 = b[1] - a[1]

    a_part = a_part_1 ** 2
    b_part = b_part_1 ** 2

    raw = math.sqrt(
            (b[0] - a[0]) ** 2 + (b[1] - a[1]) ** 2
        ) 
    #print("heuristic -->",raw, "inputs -->", a, b)

    return int(raw)

